import React, { useState } from "react";
import { Link } from "react-router-dom";
import "./MentorRegisterPage.css";

function MentorRegisterPage() {
  const [mentorForm, setMentorForm] = useState({
    fullName: "",
    email: "",
    contactNumber: "",
    employeeId: "",
    dob: "",
    password: "",
    confirmPassword: "",
  });

  const handleMentorFormChange = (event) => {
    const { name, value } = event.target;
    setMentorForm((prevForm) => ({ ...prevForm, [name]: value }));
  };

  const handleMentorFormSubmit = (event) => {
    event.preventDefault();
    // TODO: handle form submission
  };

  return (
    <div>
    <div className="container">
      <div className="form-container">
        <form onSubmit={handleMentorFormSubmit}>
          <h2>Register as Mentor</h2>
          <label>
            Full Name:
            <input
              type="text"
              name="fullName"
              value={mentorForm.fullName}
              onChange={handleMentorFormChange}
              required
            />
          </label>
          <label>
            Enterprise Email Id:
            <input
              type="email"
              name="email"
              value={mentorForm.email}
              onChange={handleMentorFormChange}
              required
            />
          </label>
          <label>
            Contact Number:
            <input
              type="tel"
              name="contactNumber"
              value={mentorForm.contactNumber}
              onChange={handleMentorFormChange}
              required
            />
          </label>
          <label>
            Employee Id:
            <input
              type="text"
              name="employeeId"
              value={mentorForm.employeeId}
              onChange={handleMentorFormChange}
              required
            />
          </label>
          <label>
            Date of Birth:
            <input
              type="date"
              name="dob"
              value={mentorForm.dob}
              onChange={handleMentorFormChange}
              required
            />
          </label>
          <label>
            Create Password:
            <input
              type="password"
              name="password"
              value={mentorForm.password}
              onChange={handleMentorFormChange}
              required
            />
          </label>
          <label>
            Confirm Password:
            <input
              type="password"
              name="confirmPassword"
              value={mentorForm.confirmPassword}
              onChange={handleMentorFormChange}
              required
            />
          </label>
          <div className="button-container">
            <Link to="/mentor-sign-in-page">
              <button type="submit">Register</button>
            </Link>
            <p style={{ textAlign: "center" }}>Already registered?</p>
            <a href="mentor-sign-in-page">
              <h2>Sign In</h2>
            </a>
          </div>
        </form>
      </div>
    </div>
    </div>
  );
}

export default MentorRegisterPage;
